import NavBar from "./NavBar";
import { Routes, Route } from "react-router-dom";
import Home from "./Home";

function App() {
    return (
        <div className="App">
            <Routes>
                <Route path="/">
                    <Home />
                </Route>
                <Route path="/about">
                    <About />
                </Route>
            </Routes>
            <NavBar />
        </div>
    );
}

export default App;
